import PropTypes from 'prop-types';
import React from "react";
import { Link } from "react-router-dom";
import {Nav, NavDropdown, Navbar} from "react-bootstrap";
import { Dropdown } from 'semantic-ui-react';

const options = [
  { key: 1, text: <Link to="/leistung1" className="dropdown-element-style">Leistung1</Link>, value: 1 },
  { key: 2, text: <Link to="/leistung2" className="dropdown-element-style">Leistung2</Link>, value: 2 },
  { key: 3, text: <Link to="/leistung3" className="dropdown-element-style">Leistung3</Link>, value: 3 },
  { key: 4, text: <Link to="/leistung4" className="dropdown-element-style">Leistung4</Link>, value: 4 }
]

function HeaderNavbar() {

  return (
    <Navbar id="navbar-bg" collapseOnSelect expand="lg">
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="row container-fluid navbar-center">
          <div className="col" />
          <div className="col">
            <Nav.Link as={Link} to="/home">Startseite</Nav.Link>
          </div>
          <div className="col service-portrait">
            <Nav.Link as={Link} to="/services">Leistungen</Nav.Link>
          </div>
          <Nav.Link as={Link} to="/services" className="col service-landscape" onClick={<Link to="/services" />}>
            <Dropdown options={options} text="Leistungen" onClick={<Link to={options.value} />} simple item />
          </Nav.Link>
          <div className="col">
            <Nav.Link as={Link} to="/aboutMe">Ãœber mich</Nav.Link>
          </div>
          <div className="col">
            <Nav.Link as={Link} to="/contact">Kontakt</Nav.Link>
          </div>
          <div className="col" />
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNavbar;
